import React, { useState } from "react";
import "./App.css";
import axios from "axios";
import { toast, ToastContainer } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";

function App() {
  const [file, setFile] = useState(null);
  const [key, setKey] = useState("");
  const [method, setMethod] = useState("AES");
  const [loading, setLoading] = useState(false);
  const [showKey, setShowKey] = useState(false);

  const handleFileChange = (e) => setFile(e.target.files[0]);
  const handleMethodChange = (e) => setMethod(e.target.value);

  const handleEncrypt = async () => {
    if (!file) return toast.error("Please select a file.");
    setLoading(true);

    const formData = new FormData();
    formData.append("file", file);
    formData.append("method", method);

    try {
      const res = await axios.post("http://127.0.0.1:5000/encrypt", formData, {
        headers: { "Content-Type": "multipart/form-data" },
      });

      const { filename, key } = res.data;
      if (!key) throw new Error("No key received from server");

      setKey(key);
      setShowKey(true);
      toast.success("File encrypted successfully!");

      // Trigger file download
      const fileRes = await axios.get(`http://127.0.0.1:5000/download/${filename}`, {
        responseType: "blob",
      });

      const blob = new Blob([fileRes.data]);
      const downloadUrl = window.URL.createObjectURL(blob);
      const link = document.createElement("a");
      link.href = downloadUrl;
      link.download = filename;
      link.click();

    } catch (err) {
      console.error(err);
      toast.error("Encryption failed!");
    } finally {
      setLoading(false);
    }
  };

  const handleDecrypt = async () => {
    if (!file) return toast.error("Please select a file.");
    if (!key) return toast.error("Please enter your encryption key.");

    setLoading(true);
    const formData = new FormData();
    formData.append("file", file);
    formData.append("method", method);
    formData.append("key", key);

    try {
      const res = await axios.post("http://127.0.0.1:5000/decrypt", formData, {
        responseType: "blob",
      });

      // Get filename from Content-Disposition
      const disposition = res.headers["content-disposition"];
      const match = disposition && disposition.match(/filename="?([^"]+)"?/);
      const filename = match ? match[1] : "decrypted_file";

      // Trigger download
      const blob = new Blob([res.data]);
      const downloadUrl = window.URL.createObjectURL(blob);
      const link = document.createElement("a");
      link.href = downloadUrl;
      link.download = filename;
      link.click();

      toast.success("File decrypted successfully!");
    } catch (err) {
      console.error(err);
      toast.error("Decryption failed!");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="app-container">
      <h1>üîê SecureScan Encryption Suite</h1>
      <p>Select a file, choose your encryption type, and secure your data.</p>

      <div className="control-card">
        <label className="file-label">
          Select File:
          <input type="file" onChange={handleFileChange} />
        </label>

        <label className="method-label">
          Encryption Method:
          <select value={method} onChange={handleMethodChange}>
            <option value="AES">AES</option>
            <option value="RSA">RSA</option>
            <option value="Fernet">Fernet</option>
          </select>
        </label>

        {showKey && (
          <div className="key-box">
            <p><strong>Encryption Key:</strong></p>
            <textarea value={key} readOnly rows="4"></textarea>
            <button
              onClick={() => navigator.clipboard.writeText(key)}
              className="copy-btn"
            >
              Copy Key
            </button>
          </div>
        )}

        <div className="button-group">
          <button onClick={handleEncrypt} disabled={loading}>
            {loading ? "Encrypting..." : "Encrypt File"}
          </button>
          <button onClick={handleDecrypt} disabled={loading}>
            {loading ? "Decrypting..." : "Decrypt File"}
          </button>
        </div>
      </div>

      <ToastContainer position="bottom-right" />
    </div>
  );
}

export default App;
